import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "./App.css";
import Home from "./Components/Home/Home";

function App() {
  return (
    <Router>
      <div>
        <Routes>
          <Route path="/" element>
            <Home />
          </Route>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
